import MatchPanel from "../../components/matchPanel";
import Match from "../../components/match";
import Link from "../../components/link";
import Gap from "../../components/gap";
import InfoPanel from "../../components/infoPanel";

export default function ContentHome({ games }) {
    console.log(games);
    return (
        <div className={"lg:px-20 flex flex-row gap-20 contentHome"}>
            <div className={"flex flex-col gap-12"}>
                <InfoPanel className={"infoPanel font-bold"} headline={"Nejoblíbenější ligy"}>
                    <Gap gap={"4"}></Gap>
                    <Link classNameDiv={"flex flex-row-reverse items-center justify-end gap-3"} text={"Premier League"}><img src={"/images/englad.svg"} alt={""}/></Link>
                    <Gap gap={"4"}></Gap>
                    <Link classNameDiv={"flex flex-row-reverse items-center justify-end gap-3"} text={"Premier League"}><img src={"/images/englad.svg"} alt={""}/></Link>
                </InfoPanel>
            </div>
            <div className={"flex flex-col gap-12"}>
                <MatchPanel headline={"Liga Mistrů"} date={"Úterý 20:00"} src={"/images/englad.svg"}>
                    {games.map(game => (
                        <Match
                            key={game.id}
                            time={game.time_of_game}
                            team1Img={game.awayTeam.imageSrc}
                            team2Img={game.homeTeam.imageSrc}
                            team1={game.awayTeam.name}
                            team2={game.homeTeam.name}
                            score1={game.score1}
                            score2={game.score2}
                            id={game.id}
                        />
                    ))}
                </MatchPanel>
            </div>
        </div>
    );
}
